/*Table structure for table `guests` */

DROP TABLE IF EXISTS `guests`;

CREATE TABLE `guests` (
  `guest_id` int(11) NOT NULL AUTO_INCREMENT,
  `identification_no` varchar(255) NOT NULL,
  `identification_type_id` int(11) DEFAULT NULL,
  `nationality_id` int(11) DEFAULT NULL,
  `guest_name` varchar(255) DEFAULT NULL,
  `gender` char(1) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `present_address` text,
  `contact_no` int(11) DEFAULT NULL,
  `residing_across_border` enum('Y','N') DEFAULT 'N',
  `flag_status` enum('Y','N') DEFAULT NULL,
  PRIMARY KEY (`guest_id`,`identification_no`),
  KEY `identification_type_id` (`identification_type_id`),
  KEY `nationality_id` (`nationality_id`),
  CONSTRAINT `guests_ibfk_1` FOREIGN KEY (`identification_type_id`) REFERENCES `identificationtypes` (`identification_type_id`),
  CONSTRAINT `guests_ibfk_2` FOREIGN KEY (`nationality_id`) REFERENCES `nationality` (`nationality_id`)
) ENGINE=InnoDB AUTO_INCREMENT=336 DEFAULT CHARSET=utf8;

